(3, 2, 3, 'hello', 1486056062, 1, 0),
(4, 1, 10, 'Hey there!!! I just wanted to check the chat feature <img class=\"cometchat_smiley\" height=\"20\" width=\"20\" src=\"/pontic_dev/cometchat/writable/images/smileys/smiley.png\" title=\"Smiley\">', 1486426562, 1, 0),
(5, 14, 13, 'hello amanda are you looking for a temporary or permanent position ?', 1486489901, 0, 0),
(6, 34, 20, 'Hi Sonya.  We are seeking either a temp or permanent hygienist.  We have either a full time or part time position open.  I would love to chat with you about it.', 1486497685, 0, 0),
(7, 34, 18, 'Hi!  We are seeking either a temp or permanent hygienist.  We have either a full time or part time hygienist.  I would love to chat with you further about it.', 1486497857, 1, 0),
(8, 34, 15, 'Hi!  We are seeking either a temp or permanent hygienist.  We have either a full time or part time positions available and would love to chat with you further.', 1486498001, 0, 0),
(9, 34, 9, 'Hi!  We are seeking either a temp or permanent hygienist.  We have either a full time or part time position available & would love to chat with you further.', 1486498045, 0, 0),
(10, 35, 27, 'Hello. I noticed that you are logged in as a job seeker. Are you a dental office? or looking to temp as a dentist? If you are in fact a dental office let me know and I can fix your account. That way you can search for hygienist/assistants and create a job posing. <a href=\"mailto: contact@pontic.co\">contact@pontic.co </a>Thanks!', 1486498822, 0, 0),
(11, 33, 13, 'Hi Amanda, We are looking for a hygienist at our office in Applewoood (Wheat Ridge) monday and wednesdays let us know if you are interested!', 1486499453, 0, 0),
(12, 33, 13, '<a href=\"mailto: Applewooddentalwr@gmail.com\">Applewooddentalwr@gmail.com </a>', 1486499460, 0, 0),
(13, 33, 12, 'we are looking for a hygienist monday and wednesdays at our office in wheat ridge let us know if you are interested!', 1486499538, 1, 0),
(14, 33, 12, '<a href=\"mailto: Applewooddentalwr@gmail.com\">Applewooddentalwr@gmail.com </a>', 1486499545, 1, 0),
(15, 10, 1, 'Hey there.  I haven\'t tried to reach anyone yet.  I did set up a profile for our office and listed job availability but how come we don\'t come up in the \"search\".  Is it a different format if you are looking to fill a position as opposed to offering your skills?', 1486501475, 1, 0),
(16, 1, 10, 'So you come up for me in the search, but you\'ll only be able to see job seekers when you search', 1486503302, 1, 0),
(17, 1, 10, 'Both of your posting show up. I am going to do a tutorial later tonight.... hopefully that\'ll help. I may need to make some changes to the site.', 1486503360, 1, 0),
(18, 2, 3, 'HI', 1486550755, 1, 0),
(19, 40, 1, 'Hey want to work tomorrow for us', 1486567476, 1, 0),
(20, 40, 41, 'Hey Elizabeth! I\'m with Pontic. I just wanted to remind you to fill out your profile so offices can contact you. Your profile information will only be seen by offices and your address will NOT be seen by anyone!', 1486581109, 1, 0),
(21, 40, 37, 'Hi Ursula! I just wanted to let you know that I\'ve posted a video on how and why it\'s important to complete your profile. you can check in out on our blog or on Facebook. <a href=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\" target=\"_blank\" title=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\">https://www.pontic.co/...file/</a>', 1486581799, 0, 0),
(22, 40, 37, 'I\'ve had a few office ask me about job seekers. They believe the incomplete profiles are created for \"testing\" purposes by us.', 1486581842, 0, 0),
(23, 40, 28, 'Hey! I\'m with Pontic. I just wanted to encourage you to finish your profile. I\'ve had a few offices ask about incomplete profiles (they believe I created them to test the site). Also, I wanted to make sure you knew that other job seekers are not able to see your profile AND dental offices CANNOT see your address. Here\'s a link to a blog that shows you how to create your profile! Thanks! <a href=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\" target=\"_blank\" title=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\">https://www.pontic.co/...file/</a>', 1486582018, 1, 0),
(24, 40, 19, 'Hey! I\'m with Pontic and I noticed you haven\'t finished your profile. Here\'s a link to talk you through it. <a href=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\" target=\"_blank\" title=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\">https://www.pontic.co/...file/</a>', 1486583237, 0, 0),
(25, 40, 19, 'Also I wanted to let you know that other job seekers cannot see your profile nor can anyone see your address - it\'s for location services when you search! And offices are asking about the incomplete profiles!', 1486583298, 0, 0),
(26, 40, 18, 'Hey! I\'m with Pontic and I noticed you haven\'t finished your profile. Here\'s a link to talk you through it. <a href=\"https://www.pontic.co/...file/\" target=\"_blank\" title=\"https://www.pontic.co/...file/\">https://www.pontic.co/...file/</a>  Also I wanted to let you know that other job seekers cannot see your profile nor can anyone see your address - it\'s for location services when you search! And offices are asking about the incomplete profiles!', 1486583352, 1, 0),
(27, 40, 16, 'Hey! I\'m with Pontic and I noticed you haven\'t finished your profile. Here\'s a link to talk you through it. <a href=\"https://www.pontic.co/...file/\" target=\"_blank\" title=\"https://www.pontic.co/...file/\">https://www.pontic.co/...file/</a>', 1486583403, 0, 0),
(28, 40, 16, 'Also I wanted to let you know that other job seekers cannot see your profile nor can anyone see your address - it\'s for location services when you search! And offices are asking about the incomplete profiles!', 1486583411, 0, 0),
(29, 40, 15, 'Hey! I\'m with Pontic and I noticed you haven\'t finished your profile. Here\'s a link to talk you through it. <a href=\"https://www.pontic.co/...file/\" target=\"_blank\" title=\"https://www.pontic.co/...file/\">https://www.pontic.co/...file/</a>', 1486583433, 0, 0),
(30, 40, 15, 'Also I wanted to let you know that other job seekers cannot see your profile nor can anyone see your address - it\'s for location services when you search! And offices are asking about the incomplete profiles!', 1486583441, 0, 0),
(31, 40, 9, 'Hey! I just wanted to encouraged you to complete your profile. I\'ve had office ask about incomplete profiles (they believe they are test profiles). Also, other job seekers cannot see your profile and no one can see your address (we use it for search parameters when you\'re looking for jobs close to home). Here\'s a link that\'ll talk you through building your profile. <a href=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\" target=\"_blank\" title=\"https://www.pontic.co/how-to-create-a-job-seeker-profile/\">https://www.pontic.co/...file/</a>', 1486583609, 0, 0),
(32, 48, 13, 'Hi Amanda, I am looking for a dynamic hygienist to join our team. Please contact me if you are interested. Thank you!', 1486675276, 0, 0),
(33, 48, 38, 'Hi Kimberlee, we are looking for a dynamic hygienist to join our team. Please contact me if you\'re interested, thank you!', 1486675464, 0, 0),
(34, 40, 3, 'hey... just wanted to check how this operates', 1486746981, 1, 0),
(35, 70, 40, 'I am available today and tomorrow for Colorado Springs area', 1486995007, 1, 0),
(36, 40, 70, 'Hey this is our testing site for Pontic.', 1486996366, 1, 0),
(37, 40, 70, 'I was actually going to send an email to you this morning... I\'ve noticed that your user name is \"escael2014\" and I believe that is your email.', 1486996403, 1, 0),
(38, 40, 70, 'Well actually the whole thing reads escael2014, EDDA, Dental Assistant. I recommend using your first name instead of the \"escael2014\". It just looks computer genera this way. Also, I\'ll reach out to Colorado Springs today to see if we can get some offices for you! It\'s been a great first week, but we still have some growth to do! Thanks so much using our site!', 1486996627, 1, 0),
