INSERT INTO `jobs` (`id`, `type_id`, `office_id`, `start_date`, `end_date`, `job_position`, `description`, `is_completed`, `is_delete`, `create_at`, `updated_at`) VALUES
(9, 3, 4, '1487203200', '1770336000', 3, 'Solo private practice has an opportunity for an outgoing and enthusiastic RDH to join our team, to care for our valued patients.  The position is part time, 2 days a week, Tuesday and Thursday.  No evenings.  Skills include:  At least 1-2 years experience as a dental hygienist preferred.  Ability to help patients understand their treatment needs.  Caring for patients of all ages.  Compensation based upon experience.  ', 0, NULL, 1486430877, 1486430877),
(10, 4, 4, '1487203200', '1770336000', 3, 'Looking for a temporary hygienist on Thursdays 7:30am-4:30pm, until position is filled.  Located in Westminster.  1  patient per hour, utilize ultrasonic, friendly office.  ', 0, NULL, 1486431098, 1486431098),
(11, 2, 10, '1486944000', '1739491200', 4, 'FT dental assistant 4 day work week off on Thursdays', 0, NULL, 1486509006, 1486509006),
(13, 2, 16, '1486598400', '2277158400', 3, 'Our well established practice is looking for a 3-4 day a week hygienist to join our friendly and low key practice. We have great patients and an excellent schedule. A good hygienist here has excellent job security and lower stress than most places. Easy access to Denver and land isn\'t too expensive out here. Ft Morgan is a great small town that appreciates good people and has that Midwest small town feel.  If this sounds at all interesting to you, come check it out.', 0, NULL, 1486608530, 1486608530),
(14, 2, 19, '1486598400', '1518134400', 4, 'Busy General Dental practice in Boulder County (lafayette) looking  to add an assistant to our team. Must have the basics and we are willing to train. We use Dentrix ,Dexis and are chartless. Full benefits. email resumes. start date is right away, end date (above) is not correct. ', 0, NULL, 1486713622, 1486713622),
(19, 2, 30, '1488758400', '1581638400', 3, 'We are seeking a Dental Hygienist to join our team.  The ideal candidate should be self motivated, positive attitude and be able to work as a team player.  We are looking for 3-4 days per week.  ', 0, NULL, 1487131611, 1487131611),
(20, 3, 35, '1488153600', '1613952000', 3, 'Our busy, growing dental practice is looking for a friendly, reliable, team-oriented hygienist to join our family! We are looking for someone who enjoys treating patients of all ages. Must have great communication and interpersonal skills and enjoy building long term relationships with the patient. \r\nMust have Colorado license. Anesthesia and Nitrous certification preferred. \r\nWe are looking for Monday and Friday to start but there will be full time potential within 6 months. \r\nPlease submit resume with cover letter to crabtreedentalcenter@gmail.com.  We look forward to hearing from you.', 0, NULL, 1487299340, 1487306235),
(21, 3, 51, '1491004800', '1522540800', 3, 'We are a small, single doctor practice is looking for a permanent temp hygienist to work 1 day a week. We are looking for someone to be available to work Tuesdays OR Thursdays OR Fridays. Our ideal candidate is outgoing, self motivated and is comfortable discussing treatment plans with patients. Local anesthetic license preferred.', 0, NULL, 1487987548, 1487987548),
(22, 2, 56, '1488758400', '1496707200', 4, 'We need a second dental assistant to help our growing dental practice. Having a great personality and great work ethic is a must. Basic skills we are looking for are ability to take digital x-rays and take impressions. If you are a fast learner then we will teach you the rest. This is a one dentist practice that focuses on delivering great customer care. We do a little of everything, all with the best quality possible. We only take PPO insurance and FFS. Our office is fully computerized, using Eaglesoft software. Please forward a resume if interested.\r\n', 0, NULL, 1488302238, 1488302392),
(23, 2, 56, '1488758400', '1496707200', 2, 'Dental office seeks additional team member to help grow our practice. We are looking for someone who is upbeat, personable, and able to give great customer service. Prior dental experience preferred. Knowledge and familiarity with dental insurance also preferred. Our practice is fully computerized, utilizing Eaglesoft software and digital radiography. Solo doctor practicing quality dentistry. No HMO, only PPO and FFS', 0, NULL, 1488302323, 1488302323),
(29, 3, 65, '1489363200', '1489363200', 3, 'Part-time hygienist to work 2-3 days a week. Opportunity to expand to 4 days/week.\r\nSome benefits available.\r\nMust have CO license, and trained in local anesthesia', 0, NULL, 1488787565, 1488787565),
(30, 3, 65, '1489363200', '1489363200', 3, 'Part-time hygienist to work 2-3 days a week. Opportunity to expand to 4 days/week.\r\nSome benefits available.\r\nMust have CO license, and trained in local anesthesia', 0, NULL, 1488787585, 1488787585),
(31, 2, 88, '1489968000', '1490227200', 2, 'DENTAL FRONT DESK/RECEPTIONIST (Belleair/Pinellas Park) \r\n\r\nWe have an outstanding employment opportunity in our well established, family friendly office. We have an opening for a part time/full time front office position. Candidates must show professionalism and have excellent communication skills to join our team.\r\n\r\nMust have dental experience to be considered, insurance background helpful. Dentrix experience a plus. Motivated and friendly individuals only need to apply.\r\n\r\nJob Location:\r\nBelleair/Pinellas Park, FL 33756\r\n\r\nRequired experience:\r\ndental front desk: 1 years ', 0, NULL, 1490033276, 1490033276),
(32, 1, 86, '1490054400', '1494806400', 4, '', 0, NULL, 1490060871, 1490060871),
(33, 3, 93, '1490572800', '1900627200', 3, 'Immediate opening for an experienced hygienist.  \r\n\r\nThis is a private office, with a dedicated hygiene operatory fully equipped -- digital x-rays, IO camera, patient TV, chartless entries (easy to learn). 1 hour appointments -- we want our patients to be treated as we would like to be. No HMO, some PPO, many on our own In-Office plan.\r\n\r\nOur patients remark how \"gentle\" our hygienists are and we wish to continue this tradition with someone who can be both thorough and compassionate. This is not a \"selling\" position or office and involves working with a wonderful staff that works together as a team.\r\n\r\nWe work as a team, helping each other as needed.\r\n\r\nDays available are currently Mon and Wed. - option to add Thur too, ideally in a few months (hygienist starting dental school). We are looking for someone seeking a long-term position with us for optimal care of our patients and to join and have fun with us .\r\n\r\nMust be personable, dependable and compassionate.\r\n\r\nMay consider hygienist who can only temp 1 or both days for a while too.\r\n\r\nCompetitive salary and benefits based on experience and days worked.', 0, NULL, 1490386999, 1490386999),
(34, 2, 95, '1490572800', '1492819200', 2, 'Opening for a front office receptionist for busy family Dental office. MUST be proficient with Practice Works Dental software. MUST have experience working in dental office. Duties will include general office duties, scheduling appointments, recording insurance payments and helping maintain daily operations of the dental practice. Job will start four days per week. Monday, Tuesday, Thursday and Friday, 6:30 am to 4:30 pm. Looking for long-term commitment and someone who loves helping people. Immediate opening. Practice located in Ken Caryl Ranch area. Please submit CV. We offer a matching 401 plan and vacation pay after 6 months.', 0, NULL, 1490563533, 1490563533),
(35, 3, 111, '1493337600', '1570665600', 3, 'We are a general dentistry practice seeking a hygienist with a friendly personality, great clinical skills, great communication skills, gentle touch who will educate patients on their dental needs and will promote treatment needed. \r\nWe take great pride in our quality of dentistry and provide the best quality of care. \r\n\r\nThis position is for Thursdays. The hours are 6:30 am to 3:00 pm.\r\n\r\nRequired qualifications:\r\n5+ years Hygiene experience\r\nExperience with digital x-rays\r\nGraduate from an accredited Hygiene Program and Colorado State Board Certified. \r\nLicensed in administration of local anesthetic\r\nIndividual must be a registered dental hygienist experienced with periodontal therapy, and treatment diagnostics.\r\n\r\nPreferred but not required:\r\nProficient in Dentrix (Dentrix experience strongly preferred, but not required)\r\nBachelor degree preferred. \r\nResent OSHA and HIPAA training\r\nTraining in laser therapy\r\n', 0, NULL, 1491452212, 1491452212),
(36, 2, 116, '1491436800', '1680739200', 2, '', 0, NULL, 1491512986, 1491512986),
(37, 2, 118, '1491782400', '1588204800', 2, 'Our busy dental office is opening a 2nd location in Loveland. We are looking to add a professional, outgoing, friendly and customer service driven person to our front office team.\r\n\r\n Candidate should be comfortable with all aspects of working at a front desk and being a part providing an exceptional patient experience. This position requires a positive, friendly and outgoing demeanor. Greeting patients, checking them in, answering incoming telephone calls, confirmation calls, and re-call calls. The person in this roll must be comfortable speaking with patients and building relationships.\r\n\r\n Candidate should also be very comfortable discussing financial arrangements and presenting treatment plans to patients. A good solid understanding of dentistry is very important to the success of this position. Other functions of this position will include treatment coordinating:\r\nEducating patients on their personalized treatment plan.\r\nDiscuss financial options\r\nA solid knowledge of the in\'s and out\'s of insurance to be able to give estimates and explain patient accounts\r\nFurther patient relations through following up on outstanding treatment.\r\n\r\n Our office values our patients and providing superior customer service is very important to us; the person in this position should be ready to go above and beyond in delivering 5 Star Service in each and every facet of their job. Also, someone who is very detail oriented and who can multi-task well.\r\n\r\n This position does require someone with dental experience.\r\n\r\n This position will have shifts between the hours of Monday thru Thursday 7:30 a.m. and 7:00 p.m. and every other Friday 8:00-2:00. For a total average of approximately 25-30 hours per week.\r\n\r\n We do offer a comprehensive benefit package that does include paid time off, holiday time, medical plan and a very robust cafeteria benefits package.\r\n\r\n Please send your resume, a brief description of why you are the best candidate for this position, when you are available to start and your desired hourly rate. Candidates who do not include this information will not be considered ', 0, NULL, 1491535394, 1491535394),
(38, 2, 118, '1491782400', '1619740800', 2, 'EXPERIENCED Dental Office Treatment Coordinator/Front Office in Longmont\r\n\r\n Our busy dental office in Longmont, is looking to add a professional, outgoing, friendly and customer service driven person to our treatment coordinator/front office team.\r\n\r\n Candidate should be very comfortable discussing financial arrangements and presenting treatment plans to patients. A good solid understanding of dentistry is very important to the success of this position. The primary functions of this position will be treatment coordinating:\r\nEducating patients on their personalized treatment plan.\r\nDiscuss financial options\r\nA solid knowledge of the in\'s and out\'s of insurance to be able to give estimates and explain patient accounts\r\nFurther patient relations through following up on outstanding treatment.\r\n\r\n Candidate also should be comfortable with all aspects of working at a front desk and being a part providing an exceptional patient experience. This position requires a positive, friendly and outgoing demeanor.\r\n\r\n Additional Responsibilities to include: Greeting patients and check-in them in, patient check-out, insurance verification, and explaining benefits. The person in this roll must be comfortable speaking with patients and building relationships.\r\n\r\n Our office values our patients and providing superior customer service is very important to us; the person in this position should be ready to go above and beyond in delivering 5 Star Service in each and every facet of their job. Also, someone who is very detail oriented and who can multi-task well.\r\n\r\n This position does require someone with dental experience.\r\n\r\n This position works 2 opening shifts a week (7:30 a.m.-4:30 p.m.)., 2 closing shifts a week (10:00 a.m.-7:00 p.m.). and Friday\'s (7:30 a.m.-2:00 p.m.) \r\n\r\n We do offer a comprehensive benefit package that does include paid time off, holiday time, medical plan and a very robust cafeteria benefits package.\r\n\r\n Please send your resume, a brief description of why you are the best candidate for this position, when you are available to start and your desired hourly rate. Candidates who do not include this information will not be considered ', 0, NULL, 1491535450, 1491535450),
(39, 2, 118, '1491782400', '1651276800', 4, 'Our modern dental office located in Longmont is looking for a warm and friendly dental assistant with a minimum of 1 year of assisting experience. We are seeking a person that is comfortable discussing treatment with patients, and is customer service focused.\r\n\r\n Ability to take x-rays, impressions, and make temporary crowns preferred. Open Dental Software experience would be ideal but not required. Position will average approx. 25-30 hours per week.\r\n\r\n The office is open Monday thru Thursday 8:00 a.m.-7:00 p.m. and Friday 8:00 a.m. - 2:00 p.m.\r\n\r\n The assistants schedule would be working consistent shifts within that time frame and every Friday from 7:30 a.m.-2:00 p.m. There may be fill in hours open for opportunity if someone is out ill or vacation coverage.\r\n\r\n We do offer a comprehensive benefit package that does include paid time off, holiday time, medical plan and a very robust cafeteria benefits package.\r\n\r\n If interested please forward resume, why you are a great fit for our team and your desired hourly pay rate and what your available start date would be. We are looking to hire someone right away! ', 0, NULL, 1491535492, 1491535492),
(40, 2, 123, '1491868800', '1588550400', 4, 'Purpose of Position- Dental assistants perform a variety of patient care, office, and laboratory duties. Dental assistants prepare patients for oral examination and assist other dental professionals in providing treatment to the teeth, mouth, and gums. Dental assistants must work effectively with co-workers, customers, and others by sharing ideas in a constructive and positive manner; listening to and objectively considering ideas and suggestions from others; keeping commitments; keeping others informed of work progress, timetables and issues; addressing problems and issues constructively to find mutually acceptable and practical business solutions, and addressing others by name, actions, words and deeds. Must support the policies and goals of the Company and thus participate in the growth and future of the company.', 0, NULL, 1491874396, 1491874396),
(41, 2, 49, '1493596800', '1809043200', 3, 'We are looking for a Dental Hygienist to join our practice full time (Tues-Fri, 31 hours). We take our jobs very seriously but we like to have fun at work too! Please email your resume to us. Or stop by to drop it off and meet us!', 0, NULL, 1492035150, 1492035150),
(42, 3, 153, '1499385600', '2030313600', 3, 'Team player who is willing to take over and further develop a quality tissue management program.', 0, NULL, 1493973496, 1493973496),
(43, 2, 149, '1496016000', '1575072000', 3, 'Dental Hygienist \r\nSioux Falls General Dental office is seeking a team-oriented, self-motivated, registered dental hygienist to join our team. We excel at providing progressive comprehensive oral hygiene to support patients oral/systemic health.  We are seeking an equally progressive hygienist for this position.\r\n\r\nOur registered dental hygienist will promote dental health by completing general prophylaxis; comprehensive periodontal hygiene; provide local anesthetic; conduct oral cancer screenings; take/interpret radiographs; conduct preliminary exams; document existing/indicated treatment per doctor\'s exam; patient chart reviews; help maintain the daily hygiene schedule.\r\n\r\nESSENTIAL DUTIES AND RESPONSIBILITIES \r\n Performs dental prophylactics, removing deposits (plaque, tarter, stain) from the teeth.\r\n Performs advanced prophylactic dental procedures in the treatment of patients with related medical and dental problems, such as diabetes, cardiac complications and periodontal disease.\r\n Examines the teeth and surrounding tissues for evidence of plaque and periodontal disease and chart the findings.\r\n Inspects the throat and mouth for evidence various diseases, such as oral cancer.\r\n Exposes and interprets routine radiographs to identify tooth structures, calculus and abnormalities such as cavities, deep occlusion and suspicious lesions.\r\n Polishes teeth and applies fluoride for hypersensitivity and cavity prevention. \r\n Instructs patients at chair side in oral hygiene, brushing, flossing techniques and periodontal aides. \r\n Places local chemotherapeutics as assigned by dentist.\r\n Delivers local anesthesia when necessary as assigned by the dentist. \r\n Maintains patient record of treatment. \r\n Charts such conditions for further diagnosis and treatment by dentist. \r\n\r\nEDUCATION AND/OR EXPERIENCE: Associate of Science or Bachelor of Science Degree in Dental Hygiene. 1-2 years experience preferred. Current Licensure as a Dental Hygienist required. \r\n\r\nKNOWLEDGE, SKILLS AND ABILITIES:\r\n Ability to independently assess the nature and extent of dental, periodontal and associated pathology in dental outpatients.\r\n Knowledge of patient screening, charting and medical history procedures/documentation.\r\n Ability to perform a full range of established dental hygienist protocol and procedures.\r\n Ability to analyze medical records and prescribed protocol to formulate effective therapeutic treatment plans.\r\n Ability to set up and prepare dental equipment and instrumentation in accordance with established regulations and guidelines.\r\n Must be knowledgeable of the HIPAA act. \r\n Must be timely, meticulous and thorough with multiple details.', 0, NULL, 1494275034, 1494275034),
(44, 2, 149, '1496016000', '1798502400', 4, 'Dental Treatment Assistant\r\n\r\n\r\nAre you a team player with a great attitude?   Are you looking for an office that meets your expectations?  If so, we are looking for you. \r\n\r\n\r\nOver 3 yrs dental assisting required in a busy all-digital family practice. \r\n\r\n\r\nFax resume to 605-323-1329 or email to KarmazinDental@yahoo.com\r\n\r\n\r\nIf you have any other questions please feel free to call or email.', 0, NULL, 1494275109, 1494275109),
(55, 3, 15, NULL, NULL, 4, '.lxdxgjxxm', 1, NULL, 1500867391, 1502683900);
